text blob nat nat64 nat32 nat16 nat8 int int64 int32 int16 int8 float64 float32 bool null vec opt record variant func service principal reserved empty Candid is an interface description language created by DFINITY . It can be used to define interfaces between services (canisters), allowing canisters and clients written in various languages to easily interact with each other. Azle allows you to express Candid types through a combination of native and Azle-provided TypeScript types. These types will be necessary in various places as you define your canister. For example, Candid types must be used when defining the parameters and return types of your query and update methods. It's important to note that the Candid types are represented at runtime using specific JavaScript data structures that may differ in behavior from the description of the actual Candid type. For example, a float32 Candid type is a JavaScript Number , a nat64 is a JavaScript BigInt , and an int is also a JavaScript BigInt . Keep this in mind as it may result in unexpected behavior. Each Candid type and its equivalent JavaScript runtime value is explained in more detail in this chapter. A reference of all Candid types available on the Internet Computer (IC) can be found here . The following is a simple example showing how to import and use most of the Candid types available in Azle: import { blob, nat, nat64, nat32, nat16, nat8, int, int64, int32, int16, int8, float64, float32, Opt, Variant, Func, Principal, $query, Query
