48 GiB of stable memory Persistent across upgrades Familiar API Must specify memory id Must specify maximum key size Must specify maximum value size No migrations per memory id Stable structures are data structures with familiar APIs that allow access to stable memory. Stable memory is a separate memory location from the heap that currently allows up to 48 GiB of storage. Stable memory persists automatically across upgrades. Persistence on the Internet Computer (IC) is very important to understand. When a canister is upgraded (its code is changed after being initially deployed) its heap is wiped. This includes all global variables. On the other hand, anything stored in stable memory will be preserved. Writing and reading to and from stable memory can be done with a low-level API , but it is generally easier and preferable to use stable structures. Azle currently provides one stable structure called StableBTreeMap. It's similar to a JavaScript Map and has most of the common operations you'd expect such as reading, inserting, and removing values. Here's how to define a simple StableBTreeMap. Each StableBTreeMap must be defined in the global scope (not within any functions or objects etc): import { nat8, StableBTreeMap } from 'azle'; let map = new StableBTreeMap<nat8, string>(0, 100, 1_000); This is a StableBTreeMap with a key of type nat8 and a value of type string. Key and value types can be any Candid type . This StableBTreeMap also has a memory id of 0, a maximum key size of 100 bytes and a maximum value size of 1_000 bytes. You must statically specify the memory id, maximum key size, and maximum value sizes (they cannot be variables). Each StableBTreeMap instance must have a unique memory id. Once a memory id is allocated, it cannot be used with a different StableBTreeMap. This means you can't create another StableBTreeMap using the same memory id, and you can't change the key or value types of an existing StableBTreeMap. This problem will be addressed . Here's an