} from 'azle'; type Key = nat8;
type Value = string; type InsertResult = Variant<{ ok: Opt<Value>; err: InsertError;
}>; let map = new StableBTreeMap<Key, Value>(0, 100, 1_000); $query;
export function contains_key(key: Key): boolean { return map.contains_key(key);
} $query;
export function get(key: Key): Opt<Value> { return map.get(key);
} $update;
export function insert(key: Key, value: Value): InsertResult { return map.insert(key, value);
} $query;
export function is_empty(): boolean { return map.is_empty();
} $query;
export function items(): [Key, Value][] { return map.items();
} $query;
export function keys(): Key[] { return map.keys();
} $query;
export function len(): nat64 { return map.len();
} $update;
export function remove(key: Key): Opt<Value> { return map.remove(key);
} $query;
export function values(): Value[] { return map.values();
} With these basic operations you can build more complex CRUD database applications: import { blob, ic, InsertError, nat64, ok, Opt, Principal, $query, Record, StableBTreeMap, $update, Variant
