): Promise< Variant<{ ok: nat64; err: string; }>
> { const canister_result = await token_canister.transfer(to, amount).call(); if (!ok(canister_result)) { return { err: canister_result.err }; } const transfer_result = canister_result.ok; if (!ok(transfer_result)) { return { err: JSON.stringify(transfer_result.err) }; } return { ok: transfer_result.ok };
} Azle provides an ok function that will help you determine if a result is ok or not. This provides some benefits over using in, such as if ('err' in result) or if ('ok' in result). There are other ways to check for the ok or err properties as well, feel free to experiment with the way that you prefer. They all have trade-offs. So far we have only shown a cross-canister call from an update method. Update methods can call other update methods or query methods (but not composite query methods as discussed below). If an update method calls a query method, that query method will be called in replicated mode. Replicated mode engages the consensus process, but for queries the state will still be discarded. Cross-canister calls can also be initiated from query methods (not yet live on IC mainnet but this works locally). These are known as composite queries, and in Azle they are simply async query methods. Composite queries can call other composite query methods and regular query methods. Composite queries cannot call update methods. Here's an example of a composite query method: import { CanisterResult, ExternalCanister, Principal, $query, query, Variant
} from 'azle'; class SomeCanister extends ExternalCanister { @query query_for_boolean: () => CanisterResult<boolean>;
} const some_canister = new SomeCanister( Principal.fromText('ryjl3-tyaaa-aaaaa-aaaba-cai')
); $query;
export async function query_some_canister(): Promise< Variant<{ ok: boolean; err: string; }>
> { return await some_canister.query_for_boolean().call();
} You can expect cross-canister calls within the same subnet to take up to a few seconds to complete, and cross-canister calls across subnets take about double that time . If you don't need to wait for your cross-canister call to return, you can use notify: import { CanisterResult, ExternalCanister, Principal, RejectionCode, $update, update, Variant
} from 'azle'; class SomeCanister extends ExternalCanister { @update receive_notification: () => CanisterResult<void>;
} const some_canister = new SomeCanister( Principal.fromText('ryjl3-tyaaa-aaaaa-aaaba-cai')
); $update;
export function receive_notification(): Variant<{ ok: null; err: RejectionCode;
}> { return some_canister.receive_notification().notify();
} If you need to send cycles with your cross-canister call, you can call cycles before calling call or notify: import { CanisterResult, ExternalCanister, Principal, RejectionCode, $update, update, Variant
} from 'azle'; class SomeCanister extends ExternalCanister { @update receive_notification: () => CanisterResult<void>;
} const some_canister = new SomeCanister( Principal.fromText('ryjl3-tyaaa-aaaaa-aaaba-cai')
); $update;
export function receive_notification(): Variant<{ ok: null; err: RejectionCode;
}> { return some_canister.receive_notification().cycles(1_000_000n).notify();
}

